import React from 'react';
import Card from '../UI/Card/Card';
import FoodItem from '../FoodItem/FoodItem';

// according to dummyFood
localStorage.setItem([0,0,0,0,0,0])

const Food = (props) => {
    const dummyFood = [
        {food: 'Carbonara'},
        {food: 'Spaghetti'},
        {food: 'Beef Lasagna'},
        {food: 'Aglio Olio'},
        {food: 'Mushroom Soap'},
        {food: 'Cheese Pizza'}
    ]


    return (
        <Card>
            <ul>
                {dummyFood.map((item) => {
                    return (
                        <FoodItem food={item[food]} quantity={item[quantity]}></FoodItem>
                    )
                })}
            </ul>
        </Card>
    )
}

export default Food;
